import React from "react";

import { Button, Grid, Stack, TextField, Typography } from "@mui/material";

import "./login.css";
import { padding } from "@mui/system";

export default function Login() {
  return (
    <div>
      <form className="login_form">
        <Stack
        alignItems={"center"}
        spacing={6}>
          <div>

          <TextField
          required
          id="filled-required"
          label="Email"
          placeholder="Email"
          variant="filled"

          sx={{
            background:"#ffffff",
            borderRadius:"10rem",
          }}
        />
          </div>
          <div>
          <TextField
          id="filled-password-input"
          label="Password"
          type="password"
          autoComplete="current-password"
          variant="filled"

          sx={{
            background:"#ffffff",
            borderRadius:"10rem",
          }}
        />
          </div>
          <div className="form_button">
            <Button type="submit" >Submit</Button>
          </div>
        </Stack>
      </form>
    </div>
  );
}
